#include <iostream>
#include <vector>
#include <queue>
#include <utility>
using namespace std;

class Solution{
public:
	int numIsland(vector<vector<char>>& grid){
		vector<vector<pair<int, int>>>  vvp;

		/* first check to get base island. not final. */
		for(int i=0; i<grid.size(); i++ ){
			vector<char>& vc = grid[i];
			for(int j=0; j<vc.size(); j++){
				if(vc[j] == '1'){
					pair<int, int> p = make_pair(i, j);
					check(vvp, p);
				}
			}
		}

		while(true){
			if(!checkConnection(vvp))
				break;
		}

		return vvp.size();
	}

	bool checkConnection(vector<vector<pair<int, int>>>& vvp){
		bool isHas = false;
		for(int i=0; i<vvp.size(); i++){
			auto& vp = vvp[i];
			for(int j=i+1; j<vvp.size(); j++){
				if(hasConnection(vp, vvp[j]) == 1){
					vp.insert(vp.end(), vvp[j].begin(), vvp[j].end());
					vvp.erase(vvp.begin() + j);
					j--;
					isHas = true;
				}
			}
		}

		return isHas;
	}

	int hasConnection(vector<pair<int, int>>& v1, vector<pair<int, int>>& v2){
		for(auto& x : v1){
			for(auto& y : v2){
				if((abs(x.first - y.first) == 1 && x.second == y.second) ||
						(x.first==y.first && abs(x.second-y.second) == 1)){
					return 1;
				}
			}
		}

		return 0;
	}

	void check(vector<vector<pair<int, int>>>& vvp, pair<int, int> point){
		for(auto& vp : vvp){
			for(int i=0; i<vp.size(); i++){
				auto& p = vp[i];
				if((p.first == point.first && abs(p.second-point.second)==1) || 
						(p.second == point.second && abs(p.first - point.first)==1)){
					vp.push_back(point);
					return;
				}
			}
		}
		vector<pair<int, int>> nvp{point};
		vvp.push_back(nvp);
		return;
	}
};

